import { SET_NAVBAR_IS_ANIMATING } from '../actions/types';

const navbarIsAnimatingReducer = (state = false, action) => {
  switch (action.type) {
    case SET_NAVBAR_IS_ANIMATING:
      return  action.payload;  
    default:
      return state
  }
}

export default navbarIsAnimatingReducer;
